Verenigd Koninkrijk / Verenigde Staten
Romantiek / Komedie
90 minuten

goed

met Uma Thurman, Colin Firth en Jeffrey Dean Morgan

Emma Lloyd is presentatrice van een radioshow met een wel heel apart publiek. Behalve gewone luisteraars vermaakt Emma vooral 
mensen met liefdesverdriet en lost ook zo nu en dan eens hun problemen op. Maar een onvoorzichtige opmerking komt Emma duur te 
staan en haar leven kon nog wel eens heel ingewikkeld worden.
